import { render } from "@testing-library/react";
import React from "react";


const NavItem = ({ nav_img, nav_num }) => {


    const btnClick = () => {

        if (nav_num === 1) {
            render(
                <NavItem></NavItem>
            );
        }
        if (nav_num === 2) {
            console.log(2)
        }
        if (nav_num === 3) {
            console.log(3)
        }
        if (nav_num === 4) {
            console.log(4)
        }

    }

    return (
        <div onClick={btnClick} id={"nav_item"+nav_num} className="nav_item">
            <div className="nav_item_img">
                <img className="btn_img" draggable="false" src={nav_img} alt="" />
            </div>
            <p> ИСТОРИЯ </p>
        </div>
    )
}

export default NavItem;
